el11481.text = "\n        \n        \n          function unCamelize(str) {\n            return str\n                .replace(/([a-z])([A-Z])/g, \'\$1_\$2\')  // insert underscore before each uppercase letter (except the first one)\n                .toLowerCase();  // convert all letters to lowercase\n        }\n        \n          function createHerbicideTypeQ(path, inclusionList, Qtiming) {\n            // fetch(\n            //   \"https://api.datalake.sante.service.ec.europa.eu/sante/pesticides/active-substances?format=json\u0026substance_category=HB%20-%20Herbicide\u0026api-version=v2.0\",\n            //   {\n            //     method: \"GET\",\n            //     // Request headers\n            //     headers: {\n            //       \"Content-Type\": \"application/json\",\n            //       \"Cache-Control\": \"no-cache\",\n            //     },\n            //   }\n            // )\n            fetch(\'./vineyard/json/active_substances_06_02_2024.json\')\n              .then((response) =\u003e response.json())\n              .then((data) =\u003e {\n                jsonObject = data;                \n                // You can use jsonData here.\n                // let QtargetEl = document.getElementById(path);\n        \n                // get all diferent values for key = \"substance_category\" in \'jsonObject\'\n                let substance_categories = jsonObject.map((x) =\u003e x.substance_category);\n                let unique_substance_categories = [...new Set(substance_categories)];\n        \n                let i = 1;\n                for (const cat of unique_substance_categories) {\n                    \n                // You can use jsonData here.\n                let QtargetEl = document.getElementById(path + \"_Activities_container\");\n                    if (cat \u0026\u0026 cat.split(\" - \") \u0026\u0026 inclusionList.includes(cat)) {\n                        let KeyComp = unCamelize(cat.split(\" - \")[1]);\n                        createQtypePesticides_thin(QtargetEl, KeyComp, i, Qtiming);\n        \n                        // create a MutationObserver for QtargetEl, and observe the changes in the subtree, when the changes are made, run the rest os the code\n                        // when element with id = QtargetEl.id + \"_\" + KeyComp + \"_Application_rem_1\" is added to the DOM, run the rest of the code\n                        // Create a new observer\n                        let observer = new MutationObserver((mutations) =\u003e {\n                        mutations.forEach((mutation) =\u003e {\n                            // Check if the addedNodes property has one or more nodes\n                            if (mutation.addedNodes.length) {\n                            mutation.addedNodes.forEach((node) =\u003e {\n                                // Check if the added node is an element and has the expected id\n                                if (node.nodeType === Node.ELEMENT_NODE \u0026\u0026 node.id === path + \"_\" + KeyComp + \"_Application_rem_1\") {\n                                //   console.log(\'Element added:\', node);\n                                // Run the rest of your code here\n                                var addOptEl= document.getElementById(path + \"_\" + KeyComp + \"_Composition_Type_nestedTableIndex_1_nestedTableIndex_1\");\n                        \n                                observer.disconnect();\n                                // get all the \'substance_name\' values for the \'substance_category\' = cat\n                                let substance_names = jsonObject.filter((x) =\u003e x.substance_category === cat).map((x) =\u003e x.substance_name);\n                                let unique_substance_names = [...new Set(substance_names)];\n                                // console.log(unique_substance_names);\n                                for (const sub_name of unique_substance_names) {\n                                    // console.log(sub_name);\n                                    var el = document.createElement(\"option\");\n                                    el.setAttribute(\"value\", sub_name);\n                                    el.innerHTML = sub_name;\n                                    addOptEl.appendChild(el);\n                                }\n                                var el = document.createElement(\'option\');\n                                el.setAttribute(\"value\", \"other\");\n                                el.innerHTML = \"Other\";\n                                addOptEl.appendChild(el);\n                                }\n                            });\n                            }\n                        });\n                        });\n        \n                        // Start observing the target element with the configured parameters\n                        observer.observe(QtargetEl, { childList: true, subtree: true });\n        \n            i++;\n                    }\n                    \n                }\n                // _Composition_Type_nestedTableIndex_1_nestedTableIndex_1\n        \n                // for (const key in jsonObject) {\n                //     if \n        \n        \n                //     createQtypePesticides(targetEl, KeyComp)\n                // }\n              })\n              .catch((error) =\u003e {\n                console.error(\"Error:\", error);\n              });\n          }\n        //   let vineyard_landPrep_inclusionList = [\'HB - Herbicide\', \'AL - Algicide\', \'FU - Fungicide\', \'BA - Bactericide\', \'AC - Acaricide\', \'RO - Rodenticide\', \'IN - Insecticide\', \'MO - Molluscicide\', \'NE - Nematicide\'];\n        //   createHerbicideTypeQ(\'vineyard_landPrep\', vineyard_landPrep_inclusionList, \' before planting\');\n        \n        //   let vineyard_planting_inclusionList = [\'FU - Fungicide\'];\n        //   createHerbicideTypeQ(\'vineyard_planting\', vineyard_planting_inclusionList, \'\');\n        \n    ";
