el11486.text = "\n    // \$(document).ready(function() {\n        function call_select2 () {\n        \$(\'#vineyard_TypeAgeProd_grapeVar_Select\').select2({\n            placeholder: \"Select options\",\n            allowClear: true\n            \n        });\n    };\n    // });\n    function call_TableOps_select2() {\n        // gett all elements in document with id ending in \'_commons\'\n        var elements = document.querySelectorAll(\'[id\$=\"_commons\"]\');\n                \n        // loop through the elements and apply select2 to them\n        for (var i = 0; i \u003c elements.length; i++) {\n            \$(elements[i]).select2({\n                placeholder: \"Select options\",\n                allowClear: true\n            });\n        }\n    };\n\n\n\n    ";
